// SearchResults.js
import React from 'react';

function SearchResults({ searchResults }) {
  return (
    <div>
    {searchResults.map((result, index) => (
      <div key={index}>
        {/* Render search results */}
        {result.title}
      </div>
    ))}
  </div>
  );
}

export default SearchResults;
